import React from 'react';
import TotalChart from './components/chart/TotalChart';
import SendReport from './components/buttons/SendReport';
import MoodCheck from './components/buttons/MoodCheck';
import AwaitingTable from './components/tables/AwaitingTable';
import BlockedTable from './components/tables/BlockedTable';

function App() {
  return (
    <div style={{ display: 'flex', backgroundColor: '#f0f0f0', height: '100%' }}>
      <div style={{ flex: '1', padding: '20px' }}>
        <div style={{ backgroundColor: 'white', border: '1px solid white', borderRadius: '20px', padding: '20px', marginBottom: '20px' }}>
          <TotalChart/>
        </div>
        <div style={{ backgroundColor: 'white', border: '1px solid white', borderRadius: '20px', padding: '20px', marginBottom: '20px' }}>
          <SendReport/>
        </div>
        <div style={{ backgroundColor: 'white', border: '1px solid white', borderRadius: '20px', padding: '20px' }}>
          <MoodCheck/>
        </div>
      </div>

      <div style={{ flex: '1', padding: '20px' }}>
        <div style={{ backgroundColor: 'white', marginBottom: '20px', border: '1px solid white', borderRadius: '20px', padding: '20px' }}>
          <AwaitingTable/>
        </div>
        <div style={{ backgroundColor: 'white', border: '1px solid white', borderRadius: '20px', padding: '20px' }}>
          <BlockedTable/>
        </div>
      </div>
    </div>
  );
}

export default App;
